import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <input
          type="file"
          value={state.file}
          onChange={(e) => handleChange(e)}
        />
        <button onClick={post}>Upload</button>
      </header>
    </div>
  );
}

const [state, setState] = useState({
  file: "",
});

interface StatusData {
  status: string;
}

const handleChange = (e: File) => {
  setState({ file: e.text });
};

function post(): Promise<any> {
  return fetch("http://localhost:5000", {
    method: "POST",
    mode: "cors", // sending video
    headers: {
      file: "@/Users/alex/sources/hack-a-thing-2-23w-alexander-chen-hack-a-thing-2/server/files/example.mp4",
      accept: "multipart/form-data",
      "access-control-allow-methods": "POST",
    },
    body: state.file,
  })
    .then((response) => {
      console.log(response);
      return response;
    })
    .then((response) => response.json()) // Parse the response in JSON
    .then((response) => {
      console.log(response);
      return response as StatusData; // Cast the response type to our interface
    });
}

export default App;
